import React from "react";
import Nav from "../generalLayout/nav";

import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import Motor3dBodyTech from "../generalLayout/motor3d-body-tech";
import Motor3dBodyTech2 from "../generalLayout/motor3dBodyTech2";
import MotorSlideImg from "../generalLayout/motorSlideImg";
import { CheckNavCompact, ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
const namePage = "Brutale 1000 RR";
const listImgs = [
  {
    contentTitle: "Dedicated control unit",
    img: "brutale1000rr/electronics.jpg",
    content:
      "The Brutale 1000 RR features a full ride-by-wire multi map system with IMU inertial platform, which manages traction control with slip strategies (8 different settings and the option to deactivate it). The Brutale 1000 RR is equipped with a second generation TFT dashboard.",
  },
  {
    contentTitle: "Semi-dry sump",
    img: "brutale1000rr/technology.jpg",
    content:
      "The new splitter lubrication system, deriving from Mv Agusta’s racetrack experience, allows oil to be separated from moving mechanical parts. The semi-dry sump lubrication is capable of guaranteeing mechanical protection under extreme riding conditions such as sharp leans and wheelies.",
  },
  {
    contentTitle: "SAFETY",
    img: "brutale1000rr/safety-m.jpg",
    content:
      "The Öhlins EC electronic regulation package for the fork, the steering damper and the shock absorber fixed to the single-sided swing arm provides optimum driving control in all road conditions.",
  },
];
export default function BodyBrutale1000RR() {

  window.onscroll = function () {
    ScrollNavFunction();
    CheckNavCompact();
  };

  return (
    <>
      <PageName namePage={namePage} />
      <Nav />
      <Motor3d
        imgLocate="brutale1000rr/1000rr"
        nameModel="𝙈𝙫 𝘼𝙜𝙪𝙨𝙩𝙖 𝘽𝙧𝙪𝙩𝙖𝙡𝙚 1000 𝙍𝙍"
        price="27K€"
      />
      <br />
      <Motor3dBodyTech listImgs={listImgs} />
      <Motor3dBodyTech2 listImgs={listImgs} />
      <MotorSlideImg />
    </>
  );
}
